import { useState, FormEvent, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
type Props = {
    token: string
  };
export const DeleteCompany = (props: Props) => {
  const navigate = useNavigate();
  const { id } = useParams<{ id: any }>();
  const companyId = parseInt(id)
  useEffect(() => {
    fetch('http://localhost:8080/admin/company/delete?id=' + id, {
      method: 'POST',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).catch((error) => console.log(error));
  

  return (
    <div className='delete-company'>
      <button onClick={() => navigate(-1)}>Back</button>
      
        <label>id: </label>
        <input type="id" value={id} onChange={(event) => setId(parseInt(event.target.value))}  />
        <button type="submit">delete Company</button>
      
    </div>)
 }, [])
}
export default DeleteCompany ;
